class db(object):
    def __init__(self,DBname = 'platform.db'):
        self.crdb = sqlite3.connect(DBname)
        self.crdb.isolation_level = None
        self.yb = self.crdb.cursor()
        if DBname == 'platform.db':
            try:
                self.yb.execute('CREATE TABLE szy_config (id integer primary key autoincrement,name varchar(42) not null,rules varchar(1024))')
            except Exception as E:
                pass
            try:
                self.yb.execute('CREATE TABLE szy_soft(id integer primary key autoincrement,name varchar(42) not null,ico varchar(1024),file varchar(1024), type varchar(42))')
            except Exception as E:
                pass
            try:
                self.yb.execute('CREATE TABLE szy_place(id integer primary key autoincrement,name varchar(42) not null,list varchar(1024))')
            except Exception as E:
                pass
            try:
                self.yb.execute('CREATE TABLE szy_imags(id integer primary key autoincrement,name varchar(42) not null,data varchar(1024))')
            except Exception as E:
                pass

    def upda(self,a_data):
        self.ub = self.crdb.cursor()
        self.ub.execute(a_data)
        da = self.ub.fetchall()
        self.crdb.close()
        return da,len(da)


