class des(QWidget):
    Signal = pyqtSignal(bool)
    def __init__(self):
        super(des, self, ).__init__(None, Qt.FramelessWindowHint,)
        self.setWindowFlags(Qt.FramelessWindowHint|Qt.WindowStaysOnTopHint|Qt.Tool)
